response.about:
Приглашае Вас на обучение:
- Мастер ногтевого сервиса (маникюр, педикюр, моделирование ногтей, дизайн ногтей);
- Лейшмеккер (наращивание, химическая завивка, декорирование ресниц);
- Депиляция (восковая, сахарная);
- Косметик;
- Парикмахер;
- Визаж;
- Инъекционные методы в косметологии;
- Пилинги, уходы за кожей лица и тела;
- Контурный макияж;
- Аппаратная косметология;
- Эстетический пирсинг;
- Администратор салона красоты;
- Менеджмент салона красоты;
- Повышение квалификации сотрудников индустрии красоты.
